import React, { Component } from "react";
import "./navbar.css";

class VideoViewNavbar extends Component {
  state = {
    views: "42500000",
    title: "may may"
  };

  render() {
    return (
      <div>
        <h4 style={{ float: "left" }}>{this.state.title}</h4>
        <h4 style={{ float: "right" }}>{this.getViews()}</h4>
      </div>
    );
  }
}

export default VideoViewNavbar;
